    "2015-05-06T21:16:19.148231",nt"name": "a-high-cross-pol-isolation-multi-frequency-antenna-for-cloud-and-precipitation-research-pr",nt"isopen":
    true,nt"url": null,nt"notes": "Remote Sensing Solutions will evaluate the
    critical parameters and generate a design approach for a portable, all-weather multi-wavelength
    antenna system suitable for supporting GPM ground validation and for use in other
    NASA cloud and precipitation research programs. The antenna system will have a number
    of unique characteristics including high gain (approximately 1 deg half-power beam
    width) and matched antenna beam shapes. The antenna will support multiple frequencies
    used for cloud and precipitation sensing. The basic design will provide Ku-band
    (14 GHz) and Ka-band (35 GHz) channels that can support a variety of polarization
    and absorption-based rain retrieval algorithms. An additional 95 GHz channel will
    be considered to augment the cloud-sensing capabilities of the antenna and to allow
    particle sizing in clouds. The antenna will have extremely high cross-polarization
    isolation suitable for identifying ice cloud particle habit.",nt"license_title":
